import React from "react";
import MainNav from "../Components/mainNav";
import SmallNav from "../Components/smallNav";

function AboutUs() {
  return (
    <React.Fragment>
      <SmallNav />
      <MainNav />
    </React.Fragment>
  );
}

export default AboutUs;
